/* global psol */
import React, { useEffect, useRef } from 'react';
import $ from 'jquery';

const WebViewer3D = ({ apiData }) => {
    const viewerRef = useRef(null);

    useEffect(() => {
        if (!apiData) return;

        const loadScript = (src) => {
            return new Promise((resolve, reject) => {
                const script = document.createElement('script');
                script.src = src;
                script.onload = () => resolve();
                script.onerror = () => reject();
                document.head.appendChild(script);
            });
        };

        const initViewer = async () => {
            try {
                await loadScript('webcomponents/8.1.0/api/js/thirdparty.min.js');
                await loadScript('webcomponents/8.1.0/api/js/psol.components.min.js');

                const radialMenuActions = [
                    { name: 'menu_shading', subActions: ['actLine', 'actShade', 'actShadeLine'] },
                    { name: 'menu_rotation', subActions: ['actFront', 'actBack', 'actLeft', 'actRight', 'actTop', 'actBottom', 'actIsometric', 'actAnimate'] },
                    { name: 'menu_vr', subActions: ['actAnaglyph', 'actBluebox', 'actDreamocHD3', 'actFullscreen', 'actPseudoFullscreen'] },
                    { name: 'menu_special', subActions: ['actZoomall', 'actCut', 'actCustomDimensions', 'actExplosion', 'actLabels', 'actScreenShot'] }
                ];

                const favoriteActions = [
                    "actAnimate",
                    "actCustomDimensions",
                    "actEnableHotSpots",
                    "actHotSpots",
                    "actLine",
                    "actShadeLine",
                    "actEnv",
                    "actToggleRotationMode",
                ];

                const settings = {
                    $container: $('#viewer'),
                    viewerBackendType: psol.components.WebViewer3D.ViewerBackends.WebGL,
                    webglViewerSettings: {
                        devicePixelRatio: window.devicePixelRatio,
                        radialMenuActions: radialMenuActions,
                        favoriteActions: favoriteActions,
                        ColorTL: '#cccccc',
                        ColorTR: '#cccccc',
                        ColorML: '#eeeeee',
                        ColorMR: '#eeeeee',
                        ColorBL: '#ffffff',
                        ColorBR: '#ffffff',
                        logoTexture: 'BR.jpg',
                        logoScaleFactor: 1,
                        logoMixFactor: 0.5,
                        logoScaleModeFill: true,
                        material: { preset: 'pcloud' },
                        measureGrid: {
                            colors: {
                                dimensions: '#000000',
                                outline: '#0000ff',
                                grid: '#b3b3b3'
                            }
                        },
                        helperOptions: {
                            gridOn: false,
                            axisOn: false
                        },
                        shadeMode: psol.components.WebViewer3D.ShadeModes.ShadeAndLines,
                        enableEditableDimensions: true,
                        showPartNameTooltip: false
                    }
                };

                const viewer = new psol.components.WebViewer3D(settings);
                viewerRef.current = viewer;

                viewer.show().then(() => {
                    viewer.loadByUrl(apiData);  // Use the API data here
                });
            } catch (error) {
                console.error('Error loading PSOL scripts', error);
            }
        };

        initViewer();
    }, [apiData]);

    const refreshDiagram = (newApiData) => {
        if (viewerRef.current) {
            viewerRef.current.loadByUrl(newApiData);
        }
    };

    useEffect(() => {
        refreshDiagram(apiData);
    }, [apiData]);

    return (
        <div id="viewer" style={{ width: '640px', height: '400px' }}></div>
    );
};

export default WebViewer3D;
